import Head from 'next/head';

import Navbar from './navbar';
import Footer from './footer';

export default function Index(props){
    return(
        <main>
            <Head>
                <title>Cosmere-latam</title>
            </Head>
            <meta
        name="description"
      content="Web del fandom de Brandon Sanderson en latinoamerica."
    />
            <Navbar></Navbar>
            {props.children}
            <Footer></Footer>
        </main>
    );
}
